import React from 'react'
import SwipeCard from './Swipe-Card'
import LevelUp from './LevelUp'

class Aligner extends React.Component {
	render() {
		return(
		<div className='aligner'>
			<SwipeCard />
			<canvas id="confetti"></canvas>
			<LevelUp />
		</div>
			)

	}
}
export default Aligner
